import React from 'react';
import './ReadPage.css'; // CSS 파일 연결

const ReadPage = () => {
  return (
    <div className="readPage">
      <h1>READ PAGE</h1>
      <div className="playListContainer">
        <div className="playListCard">Playlist Item 1</div>
        <div className="playListCard">Playlist Item 2</div>
        <div className="playListCard">Playlist Item 3</div>
      </div>
    </div>
  );
};

export default ReadPage;
